//custom code
$('.cityvalues').click(function(){
	$('.js-city-toggle-show').text($(this).text());
	$('.js-cities').slideToggle('slow');
	
	$('#search_city').val($(this).attr('cityid'));
	$.get('users/get_specialities/'+$(this).attr('cityid'), function(data) {
		var htmldata = "";
		data = JSON.parse(data);
		if(data.length > 0) {		
			
			for(var i = 0; i < data.length; i++) {
				//console.log(data[i]);
				htmldata += '<p><a href="javascript://" class="spcvalues" spcid="'+data[i].Specialty.id+'">'+data[i].Specialty.name+'</a></p>'; 
			}
			
		} else {
			$('.js-specialty-toggle-show').text('Specialty');
			htmldata = '<p><a href="">No specialties found</a></p>';
		}
		$('.js-specialties').html(htmldata);
	});
});

$('.spcvalues').live('click', function() {
	var searchcity = $('#search_city').val();
	
		var txt = $(this).text();
	txt = $.trim(txt).substring(0, 20).trim(this);
	$('.js-specialty-toggle-show').text(txt);
	$('.js-specialties').slideToggle('slow');
	$('#search_speciality').val($(this).attr('spcid'));
	$.get('users/get_hospitals/'+searchcity+'/'+$(this).attr('spcid'), function(data) {
		var htmldata = "";
		data = JSON.parse(data);
		if(data.length > 0) {		
			
			for(var i = 0; i < data.length; i++) {
				//console.log(data[i]);
				htmldata += '<p><a href="javascript://" class="hvalues" hid="'+data[i].Clinic.id+'">' + data[i].Clinic.name + '</a></p>'; 
			}
			
		} else {
			htmldata = '<p><a href="">No hospitals found</a></p>';
		}
		$('.js-insurances').html(htmldata);
	});
	
    
});

$('.hvalues').live("click",function(){
	var txt = $(this).text();
	txt = $.trim(txt).substring(0, 20).trim(this);
	$('.js-insurances-toggle-show').text(txt);
	$('.js-insurances').slideToggle('slow');
	
	//$('.js-cities').slideToggle('slow');
	$('#search_hospital').val($(this).attr('hid'));
	
});

function check_search() {
	var searchcity = $('#search_city').val();
	if (searchcity == ""){
		$('.find-tm').text('Please select city').css('color','red');
                setTimeout(function(){
                  $('.find-tm').text('');
                },5000);
		return false;
	} else {
		document.getElementById('mainSearchForm').submit()
	}
	
}

$(document).ready(function(){
	$.post('users/get_new_data', function(data){
		var resp = JSON.parse(data);
		
		if(parseInt(resp['appointment']) > 0) {
			$('ul.admin-links li').eq(0).find('.amenu-left').append('<span style="margin-left: 93px; cursor:pointer; background: none repeat scroll 0% 0% rgb(255, 0, 0); border-radius: 50%; margin-top: -69px; text-align: center; color: rgb(255, 255, 255); font-weight: bold; padding-top: 3px; height: 23px; width:27px;">'+resp['appointment']+'</span>');
		}
		
		
		if(parseInt(resp['user']) > 0) {
			
			$('ul.admin-links>li').eq(3).find('.amenu-left').append('<span style="margin-left: 93px;cursor:pointer;  background: none repeat scroll 0% 0% rgb(255, 0, 0); border-radius: 50%; margin-top: -69px; text-align: center; color: rgb(255, 255, 255); font-weight: bold; padding-top: 3px; height: 23px; width:27px;">'+resp['user']+'</span>');
		}
		
	});
});

